description:
Laure caught her husband fornicating with a passing beauty. Deeply appalled, she comes under the influence of Matalana, a gorgeous voodoo sorceress.
In the hope of making her unfaithful husband come back, Laure complies with the fantasy of perverse erotomaniac, under the eager and concupiscent glance of the witch...

